ClosestToPrior[\[CapitalSigma]_, Tmat_, \[CapitalSigma]n_] := 
    ClosestToPrior[\[CapitalSigma], Tmat, \[CapitalSigma]n] = 
     If[\[CapitalSigma] === \[CapitalSigma]n[1], 
      Closest[Tmat, \[CapitalSigma]], Closest[ClosestToPrior[
        Prior\[CapitalSigma][\[CapitalSigma], \[CapitalSigma]n], Tmat, 
        \[CapitalSigma]n], \[CapitalSigma]]]
 
Prior\[CapitalSigma][\[CapitalSigma]_, \[CapitalSigma]n_] := 
    \[CapitalSigma]n[Select[domain[\[CapitalSigma]n], 
        \[CapitalSigma]n[#1] == \[CapitalSigma] & ][[1]] - 1]
 
domain[\[CapitalSigma]n_] := Range[nMax[\[CapitalSigma]n]]
 
